import "../styles/layout/headerRingcaShort.css";

function HeaderRingcaShort() {
	return (
		<div className="header-ringca-short">
			<div className="header-ringca-short-logo-box">
				<div className="header-ringca-short-logo">ringca</div>
			</div>
		</div>
	);
}

export default HeaderRingcaShort;
